import React from 'react';
import './ActionButtons.css';

const ActionButtons = () => {
  return (
    <div className="action-buttons">
      <button className="go-back">Go back</button>
      <button className="add-to-cart">Add to cart</button>
    </div>
  );
};

export default ActionButtons;
